bioghist.p:
Een gespecificeerde omschrijving van de taken van betreffende directie luidt als volgt 

 Tevens afkomstig uit voornoemde nota. 
          :


In het kader van de agrarisch-technische hulpverlening:




Het -gevraagd en ongevraagd- adviseren van de departementale leiding en van anderen, werkzaam op het gebied van de technische ontwikkelingshulp, over het te voeren beleid;

Het opstellen en medeopstellen van hetzij departementaal hetzij interdepartementaal vast te stellen beleidslijnen;

Het geven van aanwijzingen en richtlijnen over de beleidsuitvoering aan de daarmee belaste departementale en andere organen;

Het toezien op een juiste en tijdige afdoening van de uitvoering door de c. bedoelde organen.



In het kader van de financieel-economische hulpverlening:




Het -gevraagd en ongevraagd- adviseren van de departementale leiding en van anderen werkzaam op het gebied van de financieel-economische ontwikkelingshulp, over het te voeren beleid;

Het opstellen en medeopstellen van hetzij interdepartementaal vast te stellen beleidslijnen;

Het geven van aanwijzingen en richtlijnen over de beleidsuitvoering aan de daarmee belaste departementale en andere organen;

Het -zo nodig in samenwerking met andere diensten en instellingen- voorbereiden van agrarisch-economische hulpverleningsprojecten en programma's en het medebeslissen in goedkeuring ervan;

Het toezien op een juiste en tijdige afdoening van de uitvoering, voor zover deze is opgedragen aan een andere dan de eigen directie.



In het kader van de voedselhulpverlening:




Het -gevraagd en ongevraagd- adviseren van de departementale leiding en van anderen, betrokken bij de problematiek van de voedselhulpverlening, over het te voeren beleid;

Het opstellen en medeopstellen van hetzij interdepartementaal vast te stellen beleidslijnen;

Het geven van aanwijzingen en richtlijnen over de beleidsuitvoering aan de daarmee belaste departementale en andere organen;

Het -zo nodig in samenwerking met andere diensten en instellingen- uitvoeren of doen uitvoeren van de goedgekeurde voedselhulpprojecten en programma's.



Het verrichten van studie en onderzoek ter voorbereiding van de beleidsvorming en -ontwikkeling betreffende de agrarische ontwikkelingshulp, bilateraal zowel als multilateraal.

Bij de instelling van de Directie AHO in 1969 was de directie onderverdeeld in vier afdelingen:


Afdeling Technische Hulp;

Afdeling Financieel-economische Hulp;

Afdeling Studie en Onderzoek;

Afdeling Voedselhulp.

In de loop van de jaren wijzigden de voornoemde afdelingen in:


Algemene Ontwikkelingssamenwerking;

Programma- en Projectenhulp;

Voedselvoorziening en Voedselhulp;

Secretariaat Commissie Agrarische Hulp aan Ontwikkelingslanden en Documentatie;

Bureau voor FAO-aangelegenheden;

Nederlandse FAO-commissie 

 Tot en met 1979. Doel: het adviseren van de minister van Landouw en Visserij over FAO-aangelegenheden, het bevorderen van de voorlichting over de FAO in Nederland en het leidinggeven aan bijzondere campagnes. 
              .

De onderstaande activiteiten behoorden tot het takenpakket 

 Eveneens afkomstig uit voornoemde nota. 
           van het IAC: 


het beoordelen van en adviseren over agrarische ontwikkelingsprogramma's en -projecten;

het voorbereiden, begeleiden en evalueren van de uitvoering van agrarische ontwikkelingsprogramma's en -projecten en eventueel het doen uitvoeren van ontwikkelingsprojecten;

het adviseren over de selectie en de plaatsing van deskundigen, het selecteren en voor uitzending voordragen van deskundigen, het verlenen van medewerking bij de vorming van deskundigen en de instandhouding van een corps van landbouwdeskundigen;

het organiseren van opleidingen voor buitenlandse landbouw(des)kundigen;

het deelnemen aan voorbereidingsmissies naar ontwikkelingslanden;

het behandelen en verwerken van algemene informatie over ontwikkelingslanden;

het instandhouden en beheren van lokaliteiten met logeergelegenheid;

het verlenen van diensten aan of ten behoeve van buitenlandse bezoekers aan in Nederland gevestigde landbouwinstellingen;

het verlenen van medewerking bij te organiseren bijeenkomsten op het gebied van de landbouw;

het geven van voorlichting over de ontwikkelingssamenwerking op het gebied van de landbouw.

processinfo.p:
Het bewerkte archiefblok bestond oorspronkelijk uit vier blokken:


Het eerste blok betreft de periode 1965 - 1970;

Het tweede en derde blok beslaat de periode 1971 - 1979;

Het vierde blok betreft de periode 1980 - 1984.

Ten behoeve van de overbrenging naar het Nationaal Archief dient het archief te voldoen aan de in de Regeling duurzaamheid archiefbescheiden (2001) gestelde eisen. Concreet betekent dit dat de volgende stappen zijn uitgevoerd:


Alle ijzerwerk (paperclips, nietjes, hechtmechanieken e.d.) is verwijderd;

Foto's, lichtdrukken en andere materialen die aan sterkere chemische reacties dan goed papier onderhevig zijn, zijn voorzien van afzonderlijke fourflaps;

Omslagen, archiefdozen en etiketten voldoen aan de ICN-kwaliteitseis.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
